vs/workbench/contrib/terminal/common/ter.terminal.integrated.commandsToSkipShell:
Набор идентификаторов команд, настраиваемые сочетания клавиш для которых не будут отправляться в оболочку, а вместо этого всегда будут обрабатываться с помощью VS Code. Это позволяет использовать настраиваемые сочетания клавиш, которые обычно были бы перехвачены оболочкой, как если бы на терминале не было фокуса, например, использовать сочетание клавиш "CTRL+P" для запуска Quick Open.

&nbsp;

Многие команды по умолчанию пропускаются. Чтобы переопределить значение этого параметра по умолчанию для команды и передавать настраиваемое сочетание клавиш этой команды в оболочку, добавьте команду с символом "-". Например, добавьте "-workbench.action.quickOpen", чтобы сочетание клавиш "CTRL+P" было направлено в оболочку.

&nbsp;

Следующий список команд, пропускаемых по умолчанию, обрезается при просмотре в редакторе параметров. Чтобы просмотреть полный список, [откройте файл параметров по умолчанию JSON](command:workbench.action.openRawDefaultSettings "Открыть параметры по умолчанию (JSON)") и выполните поиск первой команды из списка ниже.

